To create a sortable Bootstrap table without using jQuery or any plugins, you can use plain JavaScript. Here's a simple example of how to create an alphanumerically sortable table:

```html
<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Sortable Bootstrap Table</title>
  <link href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.0-alpha1/dist/css/bootstrap.min.css" rel="stylesheet" integrity="sha384-KyZXEAg3QhqLMpG8r+Knujsl7/1L_dstPt3HV70md2tm1DtDC+px+jBdUJQD8kY4" crossorigin="anonymous">
</head>
<body>
  <table class="table table-striped">
    <thead>
      <tr>
        <th onclick="sortTable(0)">Name</th>
        <th onclick="sortTable(1)">Age</th>
      </tr>
    </thead>
    <tbody id="myTable">
      <tr>
        <td>John Doe</td>
        <td>30</td>
      </tr>
      <tr>
        <td>Jane Smith</td>
        <td>28</td>
      </tr>
      <tr>
        <td>Mike Johnson</td>
        <td>25</td>
      </tr>
      <tr>
        <td>Sarah Brown</td>
        <td>35</td>
      </tr>
    </tbody>
  </table>

  <script>
    function sortTable(n) {
      let table, rows, switching, i, x, y, shouldSwitch, dir, switchcount = 0;
      table = document.getElementById("myTable");
      switching = true;
      dir = "asc";
      rows = table.rows;
      for (i = 1; i < rows.length - 1; i++) {
        shouldSwitch = false;
        x = rows[i].getElementsByTagName("TD")[n];
        y = rows[i + 1].getElementsByTagName("TD")[n];
        if (dir == "asc") {
          if (x.innerHTML.toLowerCase() > y.innerHTML.toLowerCase()) {
            shouldSwitch = true;
          }
        } else if (dir == "desc") {
          if (x.innerHTML.toLowerCase() < y.innerHTML.toLowerCase()) {
            shouldSwitch = true;
          }
        }
        if (shouldSwitch) {
          rows[i].parentNode.insertBefore(rows[i + 1], rows[i]);
          switchcount ++;
        }
      }
      if (switchcount == 0 && dir == "asc") {
        dir = "desc";
        switching = true;
      }
      for (i = 0; i < rows.length; i++) {
        rows[i].onclick = function() {
          this.parentNode.insertBefore(this, rows[0]);
        }
      }
    }
  </script>
</body>
</html>
```

In this example, the table has two columns: Name and Age. When you click on a header, the `sortTable()` function is called, which sorts the rows based on the clicked column. The sorting is case-insensitive, so it works for both alphabetic and numeric values.

You can add more columns to the table and adjust the `n` parameter in the `sortTable()` function to sort by the desired column.

