3. Strength Reduction: This optimization technique replaces complex expressions with simpler ones that have the same result. For example, in the following code, the expression `a * b * c` is replaced with `a * (b * c)`.

```c
#include <stdio.h>

int main() {
    int a = 5, b = 3, c = 2;
    int product = a * b * c;
    printf("The product is: %d\n", product);
    return 0;
}
```

4. Common Subexpression Elimination: This optimization technique eliminates redundant computations of the same expression. For example, in the following code, the expression `a * b` is computed twice. By storing the result in a temporary variable, the second computation can be avoided.

```c
